import "./App.css";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Navbar from "./components/Navbar";
import Home from "./components/home";
import About from "./components/about";
function App() {
  return (
    <>
      <Router>
        <Navbar />
        <Rout>
          <Route exact path="/">
            <Home />
          </Route>

          <Route exact path="/about">
            <About />
          </Route>
        </Rout>
      </Router>
    </>
  );
}

export default App;
